function() {
  return {{Error Wrapper - Function -- Library Error Wrapper}}('Referrer Hostname Sanitized - Function', function() {
    // ALTERAR para o fragmento adicionado à url para indicar que o login ocorreu via Facebook.
    // Caso o site NÃO tenha login via Facebook, não precisa fazer alterações.
    var facebookLoginFragment = '_=_'; 

    var gtm = google_tag_manager[{{Container ID}}]
      , navigationType = {{PerformanceNavigation Type}}
      , referrerHostname = {{Referrer Hostname}}
      , isOauthLogin =
          referrerHostname.includes('facebook.com') &&
          ({{Page Fragment}}.includes(facebookLoginFragment) || document.referrer.includes('/dialog/oauth'));


    // função usada na {customTask}
    // - retorna string vazia para a {customTask}, sobrescrevendo o "referrer" problemático nas tags de GA. Isso ocorre quando:
    //   - o primeiro pageview de GA já foi enviado (útil para SPAs => ver notas "problema SPA" para mais detalhes)
    //   - usuário realizou refresh/back/forward (útil para SPAs => ver notas "problema SPA" para mais detalhes)
    //   - usuário efetuou login via facebook (geraria perda de campanha por referência)
    // - cria as flags "pageviewHitSent" e "pageviewHitSent_<tid>" no Datalayer Model. Elas indicam, numa SPA, que o primeiro pageview
    //   de GA já foi enviado (por propriedade) e, portanto, os próximos hits de GA precisam ter o referral `undefined`.
    //
    // Basicamente, em SPAs temos que tomar cuidado para não criar campanhas ao passar o document.referrer nas tags de GA. Devemos, sempre
    // que necessário (pageview já enviado + refresh/back/forward), matar o field "referrer"
    var referrerHostnameSanitized = function(model) {
      var trackingId = model.get('trackingId')
        , hitType = model.get('hitType')
        , ret = referrerHostname;
      if (gtm.dataLayer.get('pageviewHitSent_' + trackingId) || navigationType !== 'NAVIGATE' || isOauthLogin) ret = '';
      if (hitType === 'pageview') {
        gtm.dataLayer.set('pageviewHitSent', true);
        gtm.dataLayer.set('pageviewHitSent_' + trackingId, true);
      }
      return ret;
    };

    // usado na {Is Referrer In Exclusion List -- Library Last Click}
    referrerHostnameSanitized.toString = function() {
      var ret = referrerHostname;
      if (gtm.dataLayer.get('pageviewHitSent') || navigationType !== 'NAVIGATE'	|| isOauthLogin) ret = '';
      return ret;
    };

    return referrerHostnameSanitized;
  }, function() { return {{Referrer Hostname}}; });
}

