variable.notes:
Retorna um boolean indicando se os 2 valores (primitivos ou objeto) passados como argumento são iguais. Funciona recursivamente, ou seja, realiza "deep equal".


Esse código passou pelos seguintes testes (Jest):




describe('Test deepEq function', () => {
  let number, symbol;

  beforeAll(() => {
    number = Math.random();
    symbol = Symbol('description');
  });

  test('it works with primitives', () => {
    // boolean
    expect(deepEq(true, true)).toBe(true);
    expect(deepEq(true, false)).toBe(false);
    expect(deepEq(false, true)).toBe(false);
    expect(deepEq(false, false)).toBe(true);

    // null
    expect(deepEq(null, null)).toBe(true);

    // undefined
    expect(deepEq(undefined, undefined)).toBe(true);

    // number
    expect(deepEq(number, number)).toBe(true);
    expect(deepEq(0, 0)).toBe(true);
    expect(deepEq(-0, 0)).toBe(true);
    expect(deepEq(-0, -0)).toBe(true);

    // string
    expect(deepEq('', '')).toBe(true);
    expect(deepEq('a', 'a')).toBe(true);
    expect(deepEq('a', 'b')).toBe(false);
    expect(deepEq('1', '1')).toBe(true);
    expect(deepEq('0', '0')).toBe(true);
    expect(deepEq('0', '-0')).toBe(false);

    // symbol
    expect(deepEq(symbol, symbol)).toBe(true);
    expect(deepEq(Symbol(), Symbol())).toBe(false);
  });

  test('it works with objects', () => {
    expect(deepEq({}, {})).toBe(true);
    expect(deepEq({ a: true }, { a: true })).toBe(true);
    expect(deepEq({ a: true }, { a: false })).toBe(false);
    expect(deepEq({ a: false }, { a: true })).toBe(false);
    expect(deepEq({ a: false }, { a: false })).toBe(true);
    expect(deepEq({ a: null }, { a: null })).toBe(true);
    expect(deepEq({ a: undefined }, { a: undefined })).toBe(true);
    expect(deepEq({ a: number }, { a: number })).toBe(true);
    expect(deepEq({ a: 0 }, { a: 0 })).toBe(true);
    expect(deepEq({ a: -0 }, { a: 0 })).toBe(true);
    expect(deepEq({ a: -0 }, { a: -0 })).toBe(true);
    expect(deepEq({ a: '' }, { a: '' })).toBe(true);
    expect(deepEq({ a: 'a' }, { a: 'a' })).toBe(true);
    expect(deepEq({ a: 'a' }, { a: 'b' })).toBe(false);
    expect(deepEq({ a: '1' }, { a: '1' })).toBe(true);
    expect(deepEq({ a: '0' }, { a: '0' })).toBe(true);
    expect(deepEq({ a: '0' }, { a: '-0' })).toBe(false);
    expect(deepEq({ a: symbol }, { a: symbol })).toBe(true);
    expect(deepEq({ a: Symbol() }, { a: Symbol() })).toBe(false);
    expect(deepEq({ a: symbol, b: { c: 3, d: number, e: { f: { g: { h: { i: { j: { k: { l: 10 } } } } } } } } }, { a: symbol, b: { c: 3, d: number, e: { f: { g: { h: { i: { j: { k: { l: 10 } } } } } } } } })).toBe(true);
    expect(deepEq({ a: symbol, b: { c: 3, d: number } }, { a: symbol, b: { c: 3, d: number } })).toBe(true);
    expect(deepEq({ a: symbol, b: { c: 3, d: number } }, { a: symbol, b: { c: 3, d: number, e: 3 } })).toBe(false);
    expect(deepEq([1, 2, 3], [1, 2, 3])).toBe(true);
    expect(deepEq({ a: [1, 2, 3] }, { a: [1, 2, 3] })).toBe(true);
    expect(deepEq({ a: [1, { b: { c: [6, 7, 8] } }, 3] }, { a: [1, { b: { c: [6, 7, 8] } }, 3] })).toBe(true);
    const fn = function() {};
    expect(deepEq(fn, fn)).toBe(true);
    expect(deepEq(function() {}, function() {})).toBe(false);
  });

  test('it throws if depth > 200', () => {
    var o1, o1ref, o2, o2ref;
    o1 = o1ref = {};
    o2 = o2ref = {};
    for (var i = 0; i < 200; i++) {
      o1.a = {};
      o1 = o1.a;
      o2.a = {};
      o2 = o2.a;
    }
    o1.a = 'a';
    o2.a = 'a';
    expect(deepEq(o1ref, o2ref)).toBe(true);

    o1.a = { a: 'a' };
    o2.a = { a: 'a' };
    expect(() => deepEq(o1ref, o2ref)).toThrow('depthCount > 200');
  });

  test('it throws if comparisons > 2000', () => {
    var o1, o2;
    o1 = Array(1000).fill(3);
    o2 = Array(1000).fill(3);
    expect(deepEq(o1, o2)).toBe(true);
    o1.push(3);
    o2.push(3);
    expect(() => deepEq(o1, o2)).toThrow('comparisonCount > 2000');
  });

  test('it ignores inherited properties', () => {
    var o1 = Object.create({ inherited: 'value1' });
    var o2 = Object.create({ inherited: 'value2' });
    o1.a = { a: { a: 'a' } };
    o2.a = { a: { a: 'a' } };
    expect(deepEq(o1, o2)).toBe(true);
  });
});

