/* version 1.3: as salvaguardas agora emitem (throw) erros */
/* version 1.2: inclusão de salvaguardas *
/* version 1.1: suporte a valores primitivos( boolean, null, undefined, number, string, symbol) além de objetos (objetos literais e arrays) */
/* version 1.0: suporte a objetos literais */

function() {
  var depthCount = 0; // salvaguarda para objetos circulares
  var comparisonCount = 0; // salvaguarda para loop infinito ou objetos muito grandes

  var equal = function(o1, o2) {
    return {{Error Wrapper - Function -- Library Error Wrapper}}('Are Objects Equal - Function', function() {
      if (o1 === o2) return true;
      if (typeof o1 !== 'object' || typeof o2 !== 'object') return false;
      for (var key in o1) {
        if (o1.hasOwnProperty(key)) {
          if (typeof o1[key] === 'object') { // precisa realizar chamada recursiva
            if (++depthCount /*incrementa antes de chamar equal()*/ > 200) throw new Error('depthCount > 200');
            var result = equal(o1[key], o2[key]);
            --depthCount; //decrementa após voltar da chamada de equal()
            if (result === false) return false;
          } else {
            if (++comparisonCount > 2000) throw new Error('comparisonCount > 2000');
            if (o1[key] !== o2[key]) return false;
          }
        }
      }
      return true;
    });
  };

  return function(o1, o2) {
    return equal(o1, o2) && equal(o2, o1);
  };
}

