function() {
  return function(namespace, initObj) {
    var GTMUtils = window.GTMUtils = window.GTMUtils || {}
      , counter = 0
      , emptyObj = {{Is Empty Object - Function}}
      , ns
      , createNS = function createNS(obj, namespaceArr) {
          counter++;
          if (typeof obj !== 'object' || !Array.isArray(namespaceArr) || counter > 20) throw new Error('problema na função "createNS"');
          if (namespaceArr.length === 0) return obj; // condição de parada
          var name = namespaceArr.shift();
          obj[name] = obj[name] || {};
          return createNS(obj[name], namespaceArr);
        };

    // Validações dos parâmetros de entrada.
    // Infelizmente, no processo de minificação, o GTM transforma `typeof(x).match(/xxx/)` em `typeof x.match(/xxx/)`,
    // mudando a ordem de execução das coisas. Devido a isso, precisa usar parênteses como abaixo.
    if (!(typeof(namespace)).match(/undefined|string/) || !(typeof(initObj)).match(/undefined|object/)) throw new Error('wrong input parameters');
    if (typeof(namespace) === 'string' && (!namespace.match(/^\w/) || namespace.match(/\.\./))) throw new Error('wrong input parameters');

    ns = namespace ? createNS(GTMUtils, namespace.split('.')) : GTMUtils;
    initObj && emptyObj(ns) && Object.assign(ns, initObj);
    return ns;
  };
}

