// version 2.1
function() {
  /** Recebe um array formato no estilo EE GA e retorna um objeto com propriedades utilizadas nas tags de Facebook.
   *  @param   {productFieldObject[]}  products                        Array de produtos no formato EE GA.
   *  @returns {Object}                facebookObj                     Objeto com as propriedades esperadas pelo Facebook.
   *  @returns {Array}                 facebookObj.content_ids
   *  @returns {Array}                 facebookObj.content_skus        Personalizada (não existe no original).
   *  @returns {Number}                facebookObj.value
   *  @returns {Number}                facebookObj.num_items
   *  @returns {Array}                 facebookObj.contents
   *  @returns {Array}                 facebookObj.contents_with_skus  Personalizada (não existe no original).
   *  @returns {Array}                 facebookObj.content_category
   *  @returns {Array}                 facebookObj.content_name
   */
  window.GTMUtils = window.GTMUtils || {};
  return window.GTMUtils.fbParamHelper = function (products) {
    return {{Error Wrapper - Function -- Library Error Wrapper}}('Facebook Products Helper Function Initialize', function() {
      if (!Array.isArray(products)) {
        return;
      }

      var idList = products.map(function(prod) {
        return !!prod.id && prod.id.toString();
      });

      var skuList;
      if (products.some(function(p) {return p.sku})) {
        skuList = products.map(function(prod) {
          return !!prod.sku && prod.sku.toString();
        });
      }

      var totalValue = +products.reduce(function(acc, cur) {
        return !!cur.price && !!cur.quantity ? acc + (cur.price * cur.quantity) : acc;
      }, 0).toFixed(2);

      var totalQuantity = products.reduce(function(acc, cur) {
        return !!cur.quantity ? acc + parseInt(cur.quantity) : acc;
      }, 0);

      var contentsArray = products.map(function(prod) {
        return {
          id: !!prod.id ? prod.id.toString() : undefined,
          item_price: !!prod.price ? parseFloat(prod.price) : undefined,
          quantity: !!prod.quantity ? parseInt(prod.quantity) : undefined
        };
      });

      var contentsSkusArray;
      if (products.some(function(p) {return p.sku})) {
        contentsSkusArray = products.map(function(prod) {
          return {
            id: !!prod.sku ? prod.sku.toString() : undefined,
            item_price: !!prod.price ? parseFloat(prod.price) : undefined,
            quantity: !!prod.quantity ? parseInt(prod.quantity) : undefined
          };
        });
      }

      var contentName = products.map(function(prod) {
        return !!prod.name && prod.name;
      });

      var contentCategory;
      if (products.some(function(p) {return p.category})) {
        contentCategory = products.map(function(prod) {
          return !!prod.category && prod.category;
        });
      }

      var contentBrand;
      if (products.some(function(p) {return p.brand})) {
        contentBrand = products.map(function(prod) {
          return !!prod.brand && prod.brand;
        });
      }

      return {
        content_ids: idList,
        content_skus: skuList, // Custom.
        value: totalValue,
        num_items: totalQuantity,
        contents: contentsArray,
        contents_with_skus: contentsSkusArray,  // Custom.
        content_category: contentCategory,
        content_name: contentName,
        content_brand: contentBrand
      };
    }); 
  };
}

