function() {
  return {{Error Wrapper - Function -- Library Error Wrapper}}('Sales Force Cart Update', function() {
    // CMT01: Cria uma variavel global para armazenar o carrinho completo
    window.salesForceCart = window.salesForceCart || [];
    // CMT02: Switch case para cada função de atualização dos produtos na variavel Global;
    var evnt = {{Event}};
    switch (evnt) {
      case 'addToCart':
        var flagIfExist = false, att = {{ecommerce.add.products - DL}}[0];
        att.id = att.id.replace("pid", "");
        for(var i = 0; i < window.salesForceCart.length ; i++){
          if(window.salesForceCart[i].id == att.id){
            window.salesForceCart[i].quantity = window.salesForceCart[i].quantity + att.quantity
            flagIfExist = true;
          }
        }
        // CMT03: Caso a variavel Global (salesForceCart) ainda não esteja setada ou se o produto ainda não existir no array, adicionamos ele no array.
        if(!flagIfExist){
          window.salesForceCart.push(JSON.parse(JSON.stringify(att)))
        }
      break;
      case 'removeFromCart':
        var att = {{ecommerce.remove.products - DL}}[0];
        att.id = att.id.replace("pid", "");
        var spliceIndex = undefined;
        for(var i = 0; i < window.salesForceCart.length ; i++){
          if(window.salesForceCart[i].id == att.id){
            window.salesForceCart[i].quantity = window.salesForceCart[i].quantity - att.quantity
            if(window.salesForceCart[i].quantity == 0){
              spliceIndex = i;
            }
          }
        }
        // CMT04: Caso a quantidade chegue a 0, remove o item da variavel Global (salesForceCart)
        spliceIndex >= 0 ? window.salesForceCart.splice(spliceIndex, 1) : null;
      break;
      case 'vPvAfterGAPageview':
        window.salesForceCart = {{ecommerce.checkout.products - DL}} || [];
      break;
      case 'checkoutStep':
        window.salesForceCart = {{ecommerce.checkout.products - DL}} || [];
      break;
    }

    return window.salesForceCart.map(function(prod){
      return {
        "item": prod.id,
        "quantity": prod.quantity,
        "price": prod.price,
        "unique_id": prod.id
      }
    });
  });
}

