function() {
  var config = {{Config -- Library Error Wrapper}}
    , containerVersion = {{Container Version}}
    , containerId = {{Container ID}}
    , isQuickPreview = containerVersion === 'QUICK_PREVIEW'

  /**
   * Send Error - função para enviar hits de erros
   * @param {string}   name      Nome da Tag ou da Variável.
   * @param {string}   msg       Mensagem a ser enviada.
   * @param {boolean}  isTag     Boolean para decidir o texto do campo "Action"
   * @param {boolean}  isWarning Cria um slot novo para disparo de warnings
   */
  return function(name, msg, isTag, isWarning) {
    if (config.debugMode || isQuickPreview) console.error((isTag ? 'Tag: ' : 'Var: ') + name + ' | ' + msg)
    if (!config.allowHitToBeSent) return
    if (isWarning) msg = 'Warning - ' + msg
    try {
      var cid = ("; "+document.cookie).split("; _ga=").pop().split(";").shift().slice(6)
    } catch (e) {
      cid = Date.now() + '.liberrorwrapper'
    }
    try {
      var sid = ("; "+document.cookie).split("; _ga_" + config.mid.slice(2)).pop().split(";").shift().match(/\.s(\d+)/)[1]
      var sct = ("; "+document.cookie).split("; _ga_" + config.mid.slice(2)).pop().split(";").shift().match(/\$o(\d+)/)[1]
    } catch (e) {
      sid = '' + Math.round(Date.now()/1000)
      sct = '1'
    }
    var dl = google_tag_manager[containerId].dataLayer.get
    var event = dl('event')
    var pixel =
      'https://analytics.google.com/g/collect?v=2'+
      '&tid='+encodeURIComponent(config.midEW)+
      '&cid='+cid+
      '&ul='+(navigator.language || '').toLowerCase()+
      '&sr='+window.screen.width+'x'+window.screen.height+
      '&_s=1'+
      '&sid='+sid+
      '&sct='+sct+
      '&seg=1'+
      '&dl='+encodeURIComponent(location.href)+
      '&dt='+encodeURIComponent(document.title)+
      '&en=error_wrapper'+
      '&ep.site_name=' + encodeURIComponent(config.siteName)+  // Site Name (Event scope) | ADICIONAR dimensão: site_name
      '&ep.entity='+encodeURIComponent((isTag ? 'Tag: ' : 'Var: ') + name)+ // Entity (Event scope) | ADICIONAR dimensão: entity
      '&ep.error_message='+encodeURIComponent(msg)+  // Error Message (Event scope) | ADICIONAR dimensão: error_message
      '&up.client_id='+encodeURIComponent(cid)+  // Client ID (User scope) | ADICIONAR dimensão: client_id
      '&ep.event_name='+encodeURIComponent(event)+  // Event Name (Event scope) | ADICIONAR dimensão: event_name
      '&ep.referrer='+encodeURIComponent(document.referrer)+  // Referrer (Event scope) | ADICIONAR dimensão: referrer
      '&ep.timestamp='+new Date().getTime()+  // Timestamp (Event scope) | ADICIONAR dimensão: timestamp
      '&ep.container_id_version='+containerId+' | '+containerVersion+  // GTM Container ID & Version (Event scope) | ADICIONAR dimensão: container_id_version
      '&ep.error_type='+(isWarning ? 'warning' : 'error')+  // Error Type (Event scope) | ADICIONAR dimensão: error_type
      '&ep.ew_version='+config.version+  // EW Version (Event scope) | ADICIONAR dimensão: ew_version
      (config.debugMode ? '&_dbg=1' : '')
    try {
      var dl_events = window.dataLayer
        .slice(-30)
        .filter(function (dl) { return dl.event }) // [{event: 'ev1', ...}, {}, {}]
        .map(function (dl) { return dl.event }) // ['ev1', 'ev2', ...]
        .join(',') // 'ev1,ev2,...'
        .slice(-100) // '...,ev8,ev9,ev10' (100 últimos caracteres)
      pixel += '&ep.dl_events=' + encodeURIComponent(dl_events) // Event List (Event scope) | ADICIONAR dimensão: dl_events
    } catch(ex) {
      pixel += '&ep.dl_events=exception'                        // Event List (Event scope) | ADICIONAR dimensão: dl_events
    }
    if (isWarning && (!window._mmNowWarning || new Date() - window._mmNowWarning > 2000)) { // throttling de 2s para warnings
      var img = document.createElement('img')
      img.width = 1
      img.height = 1
      img.src = pixel
      window._mmNowWarning = new Date()
    } else if (!window._mmNowError || new Date() - window._mmNowError > 2000) { // throttling de 2s para erros
      var img = document.createElement('img')
      img.width = 1
      img.height = 1
      img.src = pixel
      window._mmNowError = new Date()
    }
  }
}

