  window.GTMUtils = window.GTMUtils || {}
  GTMUtils.errorWrapper = GTMUtils.errorWrapper || {}

  var EW = GTMUtils.errorWrapper[containerId] = GTMUtils.errorWrapper[containerId] || function errorWrapper(name, fn, errorRet, hid, delegateHtmlSuccess) {
    try {
      if (hid && document.currentScript) { // se for uma tag, remove seu script do DOM
        var currentScript = document.currentScript
        EW.currentScripts = EW.currentScripts || []
        currentScript && EW.currentScripts.push(currentScript)
        clearTimeout(EW.timeoutId)
        EW.timeoutId = setTimeout(function() {
          try {
            EW.currentScripts.forEach(function(s) { s.parentNode.removeChild(s) })
            EW.currentScripts.length = 0 // limpa o array
          } catch(error) {}
        }, 2000) // agenda a remoção para dali 2s
