      return ret
    } catch(e) {
      // não executa a {Send Error} no modo Tag Assistance do GTM, para não poluir o console com dezenas de falsos negativos.
      debugMode === false && sendError(name, e.name + ': ' + e.message, hid)
      hid && google_tag_manager[containerId].onHtmlFailure(hid)
      if (arguments.length >= 3) return errorRet // quebra com valor de retorno default
      return null // em caso de quebra sem definir retorno default
