// version 3.7: incluindo o containerId no log
// version 3.6: exibição do tempo de execução do evento
// version 3.5: uso de "excludeFromTagFiringMonitor" (metadado) para simplificar lógica
// version 3.4: remoção da dependência do splice
// version 3.3: sendPixel to any endpoint
// version 3.2: sendPixel to Glith and enable saving tag data
// version 3.1: logs currentUrl
// version 3.0: saves eventData to GTMUtils.tagFiringMonitor

// Enter your template code here.
const log = require('logToConsole');
const copyFromDataLayer = require('copyFromDataLayer');
const addEventCallback = require('addEventCallback');
const setInWindow = require('setInWindow');
const copyFromWindow = require('copyFromWindow');
const getUrl = require('getUrl');
const sendPixel = require('sendPixel');
const JSON = require('JSON');
const localStorage = require('localStorage');
const getTimestampMillis = require('getTimestampMillis');

const eventName = copyFromDataLayer('event');
const dl_timestamp = copyFromDataLayer('timestamp');
const currentUrl = getUrl();

// tags: [{tagName, id, status, executionTime}]
const logStringified = (eventName, tags, containerId) => {
  if (tags.length) {
    let payload = '{\n';
    tags.forEach(tag => {
      payload += '' +
        '  status: ' + tag.status +
        ', id: ' + tag.id +
        ', executionTime: ' + tag.executionTime +
        ', tagName: ' + tag.tagName +
        ',\n';
    });
    payload += '}';
    if (dl_timestamp) {
      const event_time = getTimestampMillis() - dl_timestamp;
      log('[TAG FIRING MONITOR ' + containerId + '] ' + eventName + ' (' + event_time + 'ms) @ ' + currentUrl + ':');
    } else {
      log('[TAG FIRING MONITOR ' + containerId + '] ' + eventName + ' @ ' + currentUrl + ':');
    }
    log(payload);
  }
};


addEventCallback(function(containerId, eventData) {
  // Ignora tags que executam em todos os eventos.
  // Fazemos isso através do metadado excludeFromTagFiringMonitor que deve ser colocado com qualquer valor truthy
  // no corpo do template da tag.
  const tags = [];
  eventData.tags.forEach(tag => {
    if (!tag.excludeFromTagFiringMonitor) {
      tags.push(tag);
    }
  });

  if (data.enableLog) {
    logStringified(eventName, tags, containerId);
  }

  if (data.enableSaving) {
    // salva as tags em em localStorage e as expõe em GTMUtils.tagFiringMonitor
    setInWindow('GTMUtils.tagFiringMonitor', {});
    const storage = JSON.parse(localStorage.getItem('GTMtagFiringMonitor')) || {};
    tags.forEach(tag => {
      storage[tag.id] = storage[tag.id] || tag.tagName || 'undefined';
    });
    localStorage.setItem('GTMtagFiringMonitor', JSON.stringify(storage));
    setInWindow('GTMUtils.tagFiringMonitor', storage, true);
  }

  if (data.enableExternalCollector && tags.length > 0) {
    const tagIds = tags.map(tag => tag.id);
    const tagNames = tags.map(tag => tag.tagName);
    const gtmId = data.containerId; // string
    const gtmVersion = data.containerVersion;
    const payload = JSON.stringify({
      gtmId: gtmId,
      gtmVersion: gtmVersion,
      tagIds: tagIds,
      tagNames:tagNames
    });
    const collectorEndpoint = data.endpoint + '?payload=' + payload;
    sendPixel(collectorEndpoint, () => {}, () => {});
  }

});

// Call data.gtmOnSuccess when the tag is finished.
data.gtmOnSuccess();


