const JSON = require('JSON');
const toBase64 = require('toBase64');
const sendPixel = require('sendPixel');
const makeTableMap = require('makeTableMap');
const queryPermission = require('queryPermission');
const getTimestampMillis = require('getTimestampMillis');
const encodeUriComponent = require('encodeUriComponent');

const log = require('logToConsole');

const config = data.config;
const url = config.server_url + config.server_path;

if (queryPermission('send_pixel', url)) {
  log('wts permissiongranted');

  const event_id = data.override_event_id ? data.event_id : config.event_id;
  const event_timestamp = getTimestampMillis();

  let unparsed_payload = data.send_custom_payload ? data.payload : [];
  if(config.send_default_payload){
    config.payload.forEach((item)=>{unparsed_payload.push(item);});
  }
  const payload = (config.send_default_payload || data.send_custom_payload) ?makeTableMap(unparsed_payload, 'key', 'value') : {};

  log('wts preencoding');
  const encoded_event_name = encodeUriComponent(data.event_name);
  const encoded_event_id = encodeUriComponent(event_id);
  const encoded_timestamp = encodeUriComponent(event_timestamp);
  const encoded_payload = toBase64(JSON.stringify(payload));


  const final_url = url + '?en=' + encoded_event_name + '&eid=' + encoded_event_id + '&ets=' + encoded_timestamp + '&ed=' + encoded_payload;
  log('wts '+ final_url);
  sendPixel(final_url, data.gtmOnSuccess, data.gtmOnFailure);  
} else {
  data.gtmOnFailure();
}


